INSERT INTO `Events` VALUES (1,'c206d92f-58d2-4ad8-b739-ab9ab424132a','2021-04-09 18:41:54','Deleted Listing: \'Apple 21.5\" iMac\''),(3,'c206d92f-58d2-4ad8-b739-ab9ab424132a','2021-04-11 15:56:59','Created FAQ: \'How do I contact Customer Service?\' with \'Navigate to the FAQ panel through the User Profile Page. Once there, you will see a text entry on the left-hand side of your screen. Fill out your question and press submit! A representative will answer your question within the next 24 hours.\''),(7,'c206d92f-58d2-4ad8-b739-ab9ab424132a','2021-04-11 19:23:49','Created account: \'quincy@gmail.com\''),(8,'c206d92f-58d2-4ad8-b739-ab9ab424132a','2021-04-11 19:26:53','Created account: \'asdasdas@gmail.com\''),(9,'c206d92f-58d2-4ad8-b739-ab9ab424132a','2021-04-11 19:27:30','Created account: \'normalsd@gmail.com\''),(10,'c206d92f-58d2-4ad8-b739-ab9ab424132a','2021-04-11 21:33:55','Created account: \'kasper@gmail.com\''),(11,'b942d6f4-25bf-4333-8f33-e1c142d63dfe','2021-04-11 21:36:56','Answered question: \'Hey there! I\'ve placed a bid on a product that I am no longer interested in. can you please remove it?\' with \'No worries! I\'ll get that taken care of.\''),(12,'b942d6f4-25bf-4333-8f33-e1c142d63dfe','2021-04-11 21:37:11','Created FAQ: \'Test Question\' with \'Test Answer\'');
