INSERT INTO `FAQ` VALUES (1,'10aea8a9-9e22-427e-a2e1-85ea58b24bf0','c206d92f-58d2-4ad8-b739-ab9ab424132a','2021-03-30 20:04:40','2021-03-30 20:04:40','How do I win an auction?','In order to win an auction, there are two possible ways. The first way is to be the highest bidder when the auction closes. However, if the seller decided to set up a reserve price, the item will be sold when a bidder bids at or higher than the hidden reserve price.\n'),(2,'767dbd61-3703-4af5-a6b1-1eaff2daeadf','c206d92f-58d2-4ad8-b739-ab9ab424132a','2021-03-30 20:05:17','2021-03-30 20:05:17','How do I setup automatic bidding?','To set up automatic bidding on an auction listing, enter the maximum amount you would like to pay for the item and select Place bid. We will bid in increments on your behalf to keep you in the lead but only up to your limit. We will let you know if someone outbids you and you can decide if you want to increase your maximum limit.\n'),(3,'abe06fcf-f21e-4fcc-9376-ef2aa9f9a583','c206d92f-58d2-4ad8-b739-ab9ab424132a','2021-04-11 15:55:25','2021-04-11 15:55:25','How do I contact Customer Service?','Navigate to the FAQ panel through the User Profile Page. Once there, you will see a text entry on the left-hand side of your screen. Fill out your question and press submit! A representative will answer your question within the next 24 hours.'),(6,'f329fe37-63d5-415e-a0e9-322fdcb5d6fa','b942d6f4-25bf-4333-8f33-e1c142d63dfe','2021-04-11 21:37:11','2021-04-11 21:37:11','Test Question','Test Answer');
